import "./Resume.css";

const Resume = () => {
    return (
        <div class = "resume_class">
            <div class = "resume">
                <div class = "title">
                    resume
                </div> 
            </div>
            <div class = "container">
                <div class = "description">
                    everything on my website in just one pdf!
                </div> 
                <div class="hiders">
                    <p>&nbsp;</p>
                </div>

            </div>
            <div class = "pdf">
                <img src = "./documents/resume.pdf" />
            </div>


        </div>
    );
};

export default Resume;
